import React from 'react';
import { useSelector } from 'react-redux';
import { 
  CheckCircleIcon, 
  XCircleIcon, 
  TruckIcon,
  ClockIcon
} from '@heroicons/react/24/outline';

const RecentActivity = () => {
  const { orders } = useSelector((state) => state.orders);

  // Get recent activities from orders
  const getRecentActivities = () => {
    const activities = [];
    
    orders.slice(0, 10).forEach(order => {
      if (order.acceptedAt) {
        activities.push({
          id: `${order.id}-accepted`,
          type: 'accepted',
          message: `Accepted order #${order.order?.id || order.id}`,
          time: order.acceptedAt,
          icon: CheckCircleIcon,
          color: 'green'
        });
      }
      
      if (order.pickupTime) {
        activities.push({
          id: `${order.id}-picked`,
          type: 'picked_up',
          message: `Picked up order #${order.order?.id || order.id}`,
          time: order.pickupTime,
          icon: TruckIcon,
          color: 'blue'
        });
      }
      
      if (order.deliveryTime) {
        activities.push({
          id: `${order.id}-delivered`,
          type: 'delivered',
          message: `Delivered order #${order.order?.id || order.id}`,
          time: order.deliveryTime,
          icon: CheckCircleIcon,
          color: 'green'
        });
      }
      
      if (order.rejectedAt) {
        activities.push({
          id: `${order.id}-rejected`,
          type: 'rejected',
          message: `Rejected order #${order.order?.id || order.id}`,
          time: order.rejectedAt,
          icon: XCircleIcon,
          color: 'red'
        });
      }
    });
    
    // Sort by time (most recent first)
    return activities.sort((a, b) => new Date(b.time) - new Date(a.time)).slice(0, 8);
  };

  const activities = getRecentActivities();

  const formatTime = (dateString) => {
    const date = new Date(dateString);
    const now = new Date();
    const diffInMinutes = Math.floor((now - date) / (1000 * 60));
    
    if (diffInMinutes < 1) return 'Just now';
    if (diffInMinutes < 60) return `${diffInMinutes}m ago`;
    if (diffInMinutes < 1440) return `${Math.floor(diffInMinutes / 60)}h ago`;
    return date.toLocaleDateString();
  };

  const getColorClasses = (color) => {
    const colors = {
      green: 'text-green-600 bg-green-100',
      blue: 'text-blue-600 bg-blue-100',
      red: 'text-red-600 bg-red-100',
      yellow: 'text-yellow-600 bg-yellow-100',
    };
    return colors[color] || colors.blue;
  };

  return (
    <div className="bg-white rounded-lg shadow">
      <div className="p-6 border-b border-gray-200">
        <h3 className="text-lg font-semibold text-gray-900">Recent Activity</h3>
      </div>
      
      <div className="p-6">
        {activities.length === 0 ? (
          <div className="text-center py-8">
            <ClockIcon className="w-12 h-12 text-gray-400 mx-auto mb-4" />
            <p className="text-gray-600">No recent activity</p>
            <p className="text-sm text-gray-500 mt-1">
              Your recent order activities will appear here
            </p>
          </div>
        ) : (
          <div className="space-y-4">
            {activities.map((activity) => {
              const colorClasses = getColorClasses(activity.color);
              return (
                <div key={activity.id} className="flex items-start space-x-3">
                  <div className={`flex-shrink-0 p-2 rounded-full ${colorClasses}`}>
                    <activity.icon className="w-4 h-4" />
                  </div>
                  <div className="flex-1 min-w-0">
                    <p className="text-sm text-gray-900">
                      {activity.message}
                    </p>
                    <p className="text-xs text-gray-500 mt-1">
                      {formatTime(activity.time)}
                    </p>
                  </div>
                </div>
              );
            })}
          </div>
        )}
      </div>
    </div>
  );
};

export default RecentActivity;
